import React from "react";
import {BrowserRouter as Router} from 'react-router-dom'

import {useRouter} from "./pages/routes"

function App() {
  const routes = useRouter(false)
  return (
    <Router>
      <div className="wrapper">
        {routes}
      </div>
    </Router>
    )
}

export default App;
